import * as str2worker from "@hoge1e3/str2worker";
import * as assert from "assert";
export async function main(){
  const rpcu="https://cdn.jsdelivr.net/npm/@hoge1e3/rpc@1.0.1/dist/index.js";
  const rpc=await import(rpcu);
    
  const w=str2worker.create(`
import * as rpc from "${rpcu}";  
rpc.proxy.server("test",[],{
  test(x){
    return x*5;
  }
})
`);   
  const c=rpc.proxy.client(w,"test");
  this.echo(await c.test(25));
}    
